% Box 4.4	b01 = 1; b11 = -2; b21 = 1; a11 = 1.49139; a21 = -0.8997958;	b02 = 1; b12 = -1.006442; b22 = 1; a12 = 1.305644; a22 = -0.9595307;	b03 = 1; b13 = -1.890926; b23 = 1; a13 = 1.617856; a23 = -0.9617549;	b04 = 1; b14 = 2; b24 = 1;  a14 = 1.357826; a24 = -0.8956455;	F3two = 0; F5two = 0; F7two = 0; Fytwo = 0;	v = zeros(1,10);	u = zeros(1,10);	x = 1;			% The input is an impulse sequence 	for n = 0:500	% The significant part of the impulse response 					% is shorter than 500 samples		u(3) = (b01*x + b11*v(1) + b21*v(2))/1.89294776269936 + a11*v(3) + a21*v(4);		u(5) = (b02*u(3) + b12*v(3) + b22*v(4))/2.93762328797857 + a12*v(5) + a22*v(6);		u(7) = (b03*u(5) + b13*v(5) + b23*v(6))/ 3.10917453998582 + a13*v(7) + a23*v(8);		u(9) = (b04*u(7) + b14*v(7) + b24*v(8))/ 26.54949796416328 + a14*v(9) + a24*v(10);		v(2) = v(1);		% Start of updating the delay elements				v(1) = x; 		v(4) = v(3); 		v(3) = u(3); 		v(6) = v(5);		v(5) = u(5);		v(8) = v(7);		v(7) = u(7);		v(10) = v(9);		v(9) = u(9);		x = 0; 				% Reset the input after the first sample		F3two = F3two + u(3)*u(3);	% Compute the L2-norms		F5two = F5two + u(5)*u(5);			F7two = F7two + u(7)*u(7);		Fytwo = Fytwo + u(9)*u(9);	end	sqrt(F3two)	sqrt(F5two)	sqrt(F7two)	sqrt(Fytwo)